xtml.script:
function formatPhone(inPhone)
{
	var number = /\d/;
	var i = 0;
	var result;
	var outPhone="";

	while(i < inPhone.length)
	{
		result = inPhone.charAt(i).match(number);
		if ( result != null)
		{
			outPhone += inPhone.charAt(i);
		}
		i++;
	}

	Server.logInfo("RETURN VALUE: " + outPhone);
	return outPhone;

}
